import React from 'react';


const Peopleinfo = ({ name, birth_year, height, mass }) => {
    return (
        <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5 pa1">
            <h4>{name}</h4>
            <p>{birth_year}</p>
            <p>{height}</p>
            <p>{mass}</p>
        </div>  
    );
}

export default Peopleinfo;
